import React, { useContext } from 'react'
import './fooddis.css'
import StoreCon from '../../context/StoreCon.js'
import Fooditem from '../fooditem/Fooditem.js'
import { food_list } from '../assets/assets/assets.js'
const Fooddis = ({category}) => {
   // const food_item =useContext(StoreCon)
  return (
    <div className='food-dis'>
      <h2>Top dishes near you</h2>
      <div className="food-display-list">
        {food_list.map((val,ind)=>{
            return <Fooditem key={ind} id={val._id}
           description={val.description} name={val.name} price={val.price} img={val.image} />
        })}
      </div>
    </div>
  )
}

export default Fooddis
